import PropTypes from "prop-types";

function Movie({coverImage, title, summary, genres}){
    return (
        <div>
            <img src={coverImage} alt={title} />
            <h2>{title}</h2>
            <p>{summary}</p>
            <ul>
                {genres.map((genre) => (<li key={genre}>{genre}</li>))}
            </ul>
        </div>
    )
}
export default Movie;
